// Verify Table Exists
function tableExists( name ) { 
    return db.objectStoreNames.contains( name );
}

// Create Table
function createTable( name, options ) {
    options = options || { keyPath: 'id', autoIncrement: true };
    if (! tableExists( name ) ) {
        db.createObjectStore( name, options );
        mention( 'Created table: ' + name );
    }
}

// Open Table
function openTable( name, access='readonly' ) {
	const xact = db.transaction( [ name ], access );
	return xact.objectStore( name );
}

// Open Database
function openDatabase( dbname="debbie-test", dbver=1 ) {
	const req = indexedDB.open( dbname, dbver );
	req.onupgradeneeded = function( event ) {
        db = event.target.result;
        window.db = db;
        createTable( 'users' );
        mention( 'Database setup or upgrade complete' );
	}
	req.onsuccess = function( event ) {
        mention( 'Database opened' );
	}
	req.onerror = function( event ) {
        eventError( 'Error opening database', event );
	}
}

// Delete Database
function deleteDatabase( dbname ) {
  const req = indexedDB.deleteDatabase( dbname );
  req.onsuccess = function( event ) {
    mention( 'Database deleted successfully : ' + dbname );
  }
  req.onerror = function( event ) {
    eventError( 'Error deleting database', event.target.error );
  }
  req.onblocked = function( event ) {
    mention( 'Database deletion blocked' );
    mention( 'Close other windows using this database' );
  }
}

// Show database details
function showDatabaseDetails() {
	if ( db ) {
    mention( "Database : " + db.name );
    mention( "Version  : " + db.version );
    const list = Array.from( db.objectStoreNames );
	if ( list.length ) {
        while ( list.length ) {
            mention( "Table    : " + list.shift() );
	   }
    } else {
    	mention( "Tables   : none" );
    }
  } else {
    mention( "Database Connection is Closed " );
  }
}

// Add new record
function addRecord( record, tableName='users' ) {
	const table = openTable( tableName, 'readwrite' );
	const req = table.add( record );
	req.onsuccess = function( event ) {
		mention( 'Added record:' );
		mention( record );
	};
	req.onerror = function( event ) {
		eventError( 'Error adding record' , event ) ;
	};
}

// Show all records
function showAllRecords( tableName='users' ) {
	const req = openTable( tableName ).getAll();
	req.onsuccess = function( event ) {
		const records = event.target.result;
		mention( 'All records:' );
		mention( records );
	};
	req.onerror = function( event ) {
		eventError( 'Error retrieving records' , event ) ;
	};
}

